import {DAppProvider, ChainId} from "@usedapp/core";
import {Header} from "./components/header"
import {Container} from "@material-ui/core"

function App() {
  return (
    <DAppProvider config={{
      supportedChains:[ChainId.Kovan, ChainId.Rinkeby]
    }}>

          <Container maxWidth="md">
            <div>Hi</div>
          </Container>
          <Header />
      </DAppProvider>
  );
}

export default App;
